import React from 'react';
import Content from './components/Content'; // 대소문자 정확히 맞춰야 해!
import logo from './assets/logo.png';
import './App.css';

function App() {
  return (
    <div className="App">
      <h1 style={{ textAlign: 'center', marginTop: '30px' }}>공주의 콘텐츠 리스트</h1>

      <Content
        image={logo}
        title="첫 번째 콘텐츠"
        description="이것은 공주가 만든 첫 번째 콘텐츠입니다. React 컴포넌트 연습 중이에요!"
      />

      <Content
        image={logo}
        title="두 번째 콘텐츠"
        description="이미지도 바꿔봤어요. props를 이용하면 다양한 콘텐츠를 만들 수 있죠!"
      />
    </div>
  );
}

export default App;
